import React, {useEffect} from 'react';
import placeholderApi from '../../common/apis/placeholderApi';
import {useDispatch} from 'react-redux';
import {showUsers} from '../../features/users/usersSlice';
import UserListAll from '../UserListing/UserListAll';

const AlbumsUser = () => {
    const dispatch = useDispatch();
    useEffect(()=>{
        const fetchUsersList = async () => {
          const response = await placeholderApi.get(`users`)
            .catch((error)=>{
                console.log(error);
            });
            console.log("The Response from the API: ",response);
            dispatch(showUsers(response.data));
        }
        fetchUsersList();
    },[]);
  return (
    <div>
      <UserListAll/>
    </div>
  )
}

export default AlbumsUser
